def find_most_frequent(nums):
    count = {}
    max_count = 1
    for num in nums:
        if num in count:
            count[num] += 1
        else:
            count[num] = 1
        if count[num] > max_count:
            max_count = count[num]
    most_frequent = []
    for (num, freq) in count.items():
        if freq == max_count:
            most_frequent.append(num)
    most_frequent.sort(reverse=True)
    return most_frequent

